import React from 'react'

import { Link } from 'react-router-dom'

import intLOGO from '../../assets/images/interactlogo.SVG'

const LoginNav = () => {
  return (
    <header className='py-6 mb-12 border-b'>
      <div className="container mx-auto flex justify-between items-center">

        {/* logo */}
        <Link to='/'>
          <img src={intLOGO} alt="" />
        </Link>
        {/* Buttons */}
        <div className="flex items-center gap-6">
            <Link className='text-greenColor hover:text-brightColor text- transition' to='/'>Login</Link>
            <Link className='border border-solid border-thirdColor' to='/Register'>Register</Link>
        </div>
      </div>
    </header>
  );
};

export default LoginNav;
